(120, 9, 'Angelogina', 'Q.uten', 'ABRILLOdindo', NULL, 'upload/category/1744592420.jpg', 'Purok 3,Triala,Guimba, N.E', '1981-11-12', 'PONTEVEDRA, NEGROS OCCIDENTAL', 'Divorced', 'Female', 'HILIGAYNON, TAGALOG, ENGLISH', 'N/A', 'BACHELOR OF SCIENCE IN AGRICULTURE', 'BACHELOR OF SCIENCE IN AGRI-BUSINESS', 'BACHELOR OF SCIENCE IN AGRICULTURAL AND BIOSYSTEM ENGINEERING', 'My goal in applying for the degree is for my career development. This will enhance my qualification that will\r\noffer better job opportunities.', 'One year.', 'N/A', '2 years', '[\"1\",\"2\",\"4\",\"5\",\"6\",\"7\",\"8\",\"9\",\"0\"]', '[\"1\",\"2\",\"4\",\"5\",\"6\",\"7\",\"8\",\"9\",\"0\"]', '[\"1\",\"2\",\"4\",\"5\",\"6\",\"7\",\"8\",\"9\",\"0\"]', '[\"1\",\"2\",\"3\",\"4\",\"6\",\"7\"]', '[\"1\",\"2\",\"3\",\"4\",\"6\",\"7\"]', '[\"1\",\"2\",\"3\",\"4\",\"6\",\"7\"]', '[\"1\",\"2\",\"3\"]', '[\"1\",\"2\",\"3\"]', '[\"1\",\"2\",\"3\"]', '[\"1\",\"2\",\"3\"]', 'Laborer/Poultry and Livestock Focal Person', 'From: AUGUST 01,2020 to PRESENT', 'MUNICIPALITY OF PONTEVEDRA -LGU\r\nBarangay 1, Pontevedra, Negros Occidental', 'JOB ORDER', 'MA. REGINA G. ORTEGA\r\n HRMO III', 'THIS IS MY CURRENT JOB.', 'I will summarize my functions and responsibilties as follows:\r\n1. Rabies Prevention and Control Program\r\n. Conduct Information Education Campaign on rabies and responsible pet\r\n ownership.\r\n. Conduct yearly mass dog rabies vaccination in all barangays of the municipality.\r\n. Promote spaying and neutering of pets in support to the Provincial Veterinary\r\n Office program.\r\n. Quarantine of dog involved in bite case for observation and in case of dog\r\n death, prepare dog head specimen for submission to Provincial Animal Disease\r\n and Diagnostic Laboratory for analysis. In case of positive rabies result,\r\n conduct quick response vaccination of dogs within 5 Km. radius of the\r\n incident.\r\n2. Livestock and Poultry Services\r\n . Conduct deworming, vitamin and mineral supplementation to poultry and\r\n livestock during barangay animal heath mission or as requested by clients\r\n . Administration of treatment to sick animals as requested by clients. The\r\n treatment method will be recommended by the district veterinarian.\r\n . Conduct vaccinat', 'CERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF', '[\"1\",\"2\",\"3\",\"45\"]', '[\"1\",\"2\",\"3\",\"45\"]', '[\"1\",\"2\",\"3\",\"54\"]', '[\"3\",\"2\",\"1\",\"445\"]', '[\"3\",\"2\",\"1\",\"445\"]', '[\"3\",\"2\",\"1\",\"445\"]', '[\"3\",\"2\",\"1\",\"45\"]', '[\"3\",\"3\",\"3\",\"45\"]', '[\"3\",\"2\",\"2\",\"45\"]', 'N/A', '2015-10-15', 'N/A', 'Leisure activities which involve rating skills for competition and other purposes (e.g. “belt concept in Taekwondo)\r\nmay also indicate your level for ease in evaluation. On the other hand, watching Negosiyete on a regular basis can be\r\nconsidered a learning opportunity.\r\nAs a hobby I breed ornamental chickens, specifically I keep Silver Sebright bantams. Though there were show\r\ncompetition for this, I’d rather spectate and enjoy those events. I just enjoy keeping them for their unique color\r\npattern and cheerful disposition.', 'Note down those special skills which you think must be related to the field of study you want to pursue.\r\nOne special skills that I will relate is my managerial skills. As I have conveyed, I’m a ornamental chicken keeper.\r\nAnd this hobby requires management skills to maintain the flock health, feeding, housing and breeding. This\r\nskills can be applied in poultry or livestock production for effective management, ensuring productivity and\r\nprofit in all aspect of production of the project.', 'Some work-related activities are occasions for you to learn something new. For example, being assigned to\r\nprojects beyond your usual job description where you learned new skills and knowledge. Please do not include formal\r\ntraining programs you already cited. However, you may include here experiences which can be classified as on-the-job\r\ntraining or apprenticeship.\r\nOne work related activity that I did was, conducting farmers registration to Registry System for Basic Sector in\r\nAgriculture. It was done by conducting house to house registration or through farmers association in every\r\nbarangay. During this activity I learned to engage with different individuals and develop my communication and\r\ninterpersonal skills. Collecting and recording data is also a skill that I learned, making sure the accuracy in data\r\ncollection and recording. During this activity I also recognized the plight, especially among marginal farmers.\r\nI’ve realized the importance of farmers registration, because it make sure that they will have ac', 'List only volunteer activities that demonstrate learning opportunities, and are related to the course you are\r\napplying for credit. (e.g. counseling programs, sports coaching, project organizing or coordination, organizational\r\nleadership, and the like).\r\nThough I do not spearheaded programs in relation to volunteer activities, I do volunteer on tree planting\r\nprograms and coastal clean-up activitities. It is vital to know our role in protecting our environmental resources.\r\nThrough this activities it makes us aware the importance of conservation not only to those who are participating\r\nbut also to the community were the activity is conducted. In relation to the course I’m applying for,\r\nconservation of our environment also correlate to conservation of our soil and water, a vital resources in our\r\nagricultural production. Promoting environmental friendly farming practices will surely support our goal in\r\nsustainable agriculture and environmental conservation.', 'Include write-up of the nature of travel undertaken, whether for leisure, employment, business or other\r\npurposes. State in clear terms what new learning experiences was obtained from these travels and how it helped you\r\nbecome a better person.\r\nOne memorable travel for leisure I did was visiting Boracay Island with family a few years back. In there, I saw\r\nthe splendor our nature could offer and the fun and excitement we can experience from it. During this travel I\r\nlearned the importance of preserving our environment. By abiding to the island rules and regulations we can\r\ncontribute to its preservation. As a tourist, putting trash in proper disposal is one small way to support this\r\ncause. Waste is a major pollutant, especially in a small island such as Boracay, by preventing our selves from \r\nACA.ETE.YYY.F.001 (Revision No. 0; June 15, 2017)\r\nlittering is a personal way to help preserve our nature for future generations to enjoy.', 'VI. To sum up, please write an essay on how the degree you are seeking can contribute to your personal development,\r\nyour community, your workplace, society, and country.\r\nPersonally this degree will help me in my career development.Career growth means bigger\r\nresponsibilities that will equate to bigger opportunities to be able to contribute to our community. It is\r\nbecause, it validates my knowledge and capability in this field of career. This degree will give me\r\nauthority to develop programs that will provide food security and income generation to our farmers. A\r\nfood secure and earning community will contribute greatly to our nations prosperity.', 'CLSU', '1122', '20', 'XYRON G. GAREZA', '04187169', '2025-04-18', 'PONTEVEDRA NEGROS OCCIDENTAL', 'Rejected by Arlene', '2025-04-13 17:00:20', '2025-05-04 17:25:35'),
