incial Veterinary\r\n Office program.\r\n. Quarantine of dog involved in bite case for observation and in case of dog\r\n death, prepare dog head specimen for submission to Provincial Animal Disease\r\n and Diagnostic Laboratory for analysis. In case of positive rabies result,\r\n conduct quick response vaccination of dogs within 5 Km. radius of the\r\n incident.\r\n2. Livestock and Poultry Services\r\n . Conduct deworming, vitamin and mineral supplementation to poultry and\r\n livestock during barangay animal heath mission or as requested by clients\r\n . Administration of treatment to sick animals as requested by clients. The\r\n treatment method will be recommended by the district veterinarian.\r\n . Conduct vaccinat', 'CERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF COMPLETIONCERTIFICATE OF', '[\"CAPABILITY BUILDICAPABCAPABILITY BUILDICAPABILITY BUILDING TRAINING FOR LIVESTOCK TECHNOLOGY PROVIDERSNG TRAINING FOR LIVESTOCK TECHNOLOGY PROVIDERSILITY BUILDING TRAINING FOR LIVESTOCK TECHNOLOGY PROVIDERSNG TRAINING FOR LIVESTOCK TECH