ed in poultry or livestock production for effective management, ensuring productivity and\r\nprofit in all aspect of production of the project.', 'Some work-related activities are occasions for you to learn something new. For example, being assigned to\r\nprojects beyond your usual job description where you learned new skills and knowledge. Please do not include formal\r\ntraining programs you already cited. However, you may include here experiences which can be classified as on-the-job\r\ntraining or apprenticeship.\r\nOne work related activity that I did was, conducting farmers registration to Registry System for Basic Sector in\r\nAgriculture. It was done by conducting house to house registration or through farmers association in every\r\nbarangay. During this activity I learned to engage with different individuals and develop my communication and\r\ninterpersonal skills. Collecting and recording data is also a skill that I learned, making sure the accuracy in data\r\ncollection and recording. During this activity I also recognized the plight, especially among marginal farmers.\r\nI’ve realized the importance of farmers registration, because it make sure that they will have ac', 'List only volunteer activities that demonstrate learning opportunities, and are related to the course you are\r\napplying for credit. (e.g. counseling programs, sports coaching, project organizing or coordination, organizational\r\nleadership, and the like).\r\nThough I do not spearheaded programs in relation to volunteer activities, I do volunteer on tree planting\r\nprograms and coastal clean-up activitities. It is vital to know our role in protecting our environmental resources.\r\nThrough this activities it makes us aware the importance of conservation not only to those who are participating\r\nbut also to the community were the activity is conducted. In relation to the course I’m applying for,\r\nconservation of our environment also correlate to conservation of our soil and water, a vital resources in our\r\nagricultural production. Promoting environmental friendly farming practices will surely support our goal in\r\nsustainable agriculture and environmental conservation.', 'Include write-up of the nature of travel undertaken, whether for leisure, employment, business or other\r\npurposes. State in clear terms what new learning experiences was obtained from these travels and how it helped you\r\nbecome a better person.\r\nOne memorable travel for leisure I did was visiting Boracay Island with family a few years back. In there, I saw\r\nthe splendor our nature could offer and the fun and excitement we can experience from it. During this travel I\r\nlearned the importance of preserving our environment. By abiding to the island rules and regulations we can\r\ncontribute to its preservation. As a tourist, putting trash in proper disposal is one small way to support this\r\ncause. Waste is a major pollutant, especially in a small island such as Boracay, by preventing our selves from \r\nACA.ETE.YYY.F.001 (Revision No. 0; June 15, 2017)\r\nlittering is a personal way to help preserve our nature for future generations to enjoy.', 'VI. To sum up, please write an essay on how the degree you are seeking can contribute to your personal development,\r\nyour community, your workplace, society, and country.\r\nPersonally this degree will help me in my career development.Career growth means bigger\r\nresponsibilities that will equate to bigger opportunities to be able to contribute to our community. It is\r\nbecause, it validates my knowledge and capability in this field of career. This degree will give me\r\nauthority to develop programs that will provide food security and income generation to our farmers. A\r\nfood secure and earning community will contribute greatly to our nations prosperity.', 'CLSU', '1122', '20', 'XYRON G. GAREZA', '04187169', '2025-04-18', 'PONTEVEDRA NEGROS OCCIDENTAL', 'Rejected by Arlene', '2025-04-14 19:07:53', '2025-05-04 17:33:4